import DownloadButton from '../../components/Button';

// This could be a component in the container folder.
export default function MyBackground() {
  return (
    // <div className="mt-9 w-full flex justify-center items-center">
    //   <div className='w-1/2 flex justify-center'>
    //     <img src='assets/Images/student.jpeg' alt='student' className='drop-shadow-xl w-3/4' />
    //   </div>
    //   <div className='w-1/2 mr-10'>
    //     <span className="text-4xl font-semibold text-gray-700">My Background</span>
    //     <p className="mt-5 text-gray-600 text-[20px] leading-relaxed">
    //       A graduate student from the University of Nottingham, pursed a bachelor in Computer Science with Artificial intelligence.
    //       During my academic journey, I had the chance to experience different areas of computer science, and found myself more into
    //       web developing, machine learning, and data analysis.
    //     </p>
    //     <DownloadButton path="assets/PDFs/Rashed Alaleeli Resume.pdf" title="Download CV" />
    //   </div>
    // </div>
    <div className="mt-9 w-full flex flex-col-reverse md:flex-row justify-center items-center">
      <div className="w-full md:w-1/2 flex justify-center">
        <img src="assets/Images/student.jpeg" alt="student" className="drop-shadow-xl w-3/4" />
      </div>
      <div className="w-full md:w-1/2">
        <span className="text-4xl font-semibold text-gray-700">My Background</span>
        <p className="mt-5 text-gray-600 text-[20px] leading-relaxed">
          A graduate student from the University of Nottingham, pursued a bachelor's in Computer Science with Artificial intelligence.
          During my academic journey, I had the chance to experience different areas of computer science, and found myself more into
          web development, machine learning, and data analysis.
        </p>
        <DownloadButton path="assets/PDFs/Rashed Alaleeli Resume.pdf" title="Download CV" />
      </div>
    </div>
  );
}
